import React from 'react'
import { SetData, TeamList } from '../Alies'

const Fetchers = async (setData:SetData) => {


    await fetch('http://localhost:9091/teaminfo', {
        method: 'GET'})
    .then(res => res.json())
    .then(data => {
        setData.teamList = data["Value"]
        console.log(setData.teamList)
    })

}

export default Fetchers
